// Measuring the Critical Rendering Path with Navigation Timing
// https://developers.google.com/web/fundamentals/performance/critical-rendering-path/measure-crp
function logCRP(){"use strict";var t=window.performance.timing,o=t.domContentLoadedEventStart-t.domLoading,n=t.domComplete-t.domLoading,e=document.getElementById("crp-stats");e.textContent="DCL: "+o+"ms, onload: "+n+"ms"}window.addEventListener("load",function(){logCRP()});